package com.combineTwoString;

public class ListNode {

	int val;
	ListNode next = null;
	public ListNode() {
		// TODO Auto-generated constructor stub
	}
	public ListNode(int val) {
		// TODO Auto-generated constructor stub
		this.val=val;
	}
	public int getVal() {
		return val;
	}
	public void setVal(int val) {
		this.val = val;
	}
	public ListNode getNext() {
		return next;
	}
	public void setNext(ListNode next) {
		this.next = next;
	}
	
}
